} from 'reactstrap';

import './Employee.css'
import './Dashboard.css'
const Employee = (props) => {
    return (
        <div>
            <Card className='top-bar'>
                <CardBody>
                    <h5>Employee Directory</h5>
                    {/* <input type='search' name='search' className='search'></input> */}
                </CardBody>
            </Card>
        </div>
    );
}

export default Employee;
